import React from 'react';
import styled from 'styled-components';
const MainCompo = ({ title, children }) => {
  const Root = styled.div`
    background-color: skyblue;
    height: 100px;
    weight: 100px;
  `;
  return (
    <>
      <Root>{(title, children)}</Root>
    </>
  );
};

export default MainCompo;
